import search_icon from './search_icon.png'
import basket_icon from './basket_icon.png'


export const assets = {
    basket_icon,
    search_icon,
}

export const menu_list = [
    {
        menu_name: "Salad",
        menu_image: manu_1
    },
    {
        menu_name: "Rolls",
        menu_image: manu_2
    }
]
